import React from 'react';
import { withStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';

const useStyles = (theme) => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),
      width: '25ch',
    },
  },
});

class LoginForm extends React.Component {
    constructor(props)
    {
        super(props);
        this.state={
            username:"",
            password:""
        }
        this.handleChange = this.handleChange.bind(this);

        this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleChange(event) {
      this.setState({username: event.target.value});
      console.log(this.state.username);
    }



    handleSubmit(event) {
      alert('A name was submitted: ' + this.state.value);
      event.preventDefault();
    }




  render(){


  const {classes} = this.props;

  return (
    <form className={classes.root} noValidate autoComplete="off" onSubmit={this.handleSubmit}>
      <TextField id="standard-basic" label="Standard" value={this.state.value} onChange={this.handleChange}/>
      <TextField
          id="standard-password-input"
          label="Password"
          type="password"
          value={this.state.value} onChange={this.handleChange2}

        />
    </form>
  );
    }
}
export default withStyles(useStyles)(LoginForm)
